cwSk4IzrCmVuZHN0cmVhbQplbmRvYmoKCnN0YXJ0eHJlZgoyOTIyODYwCiUlRU9G"}.data;
        function queueRenderPage(num) {
            if (pageRendering) {
                pageNumPending = num;
            } else {
                renderPage(num);
            }
        }
        function onPrevPage() {
            if (pageNum <= 1) {
                return;
            }
            pageNum--;
            queueRenderPage(pageNum);
        }
        function onNextPage() {
            if (pageNum >= pdfDoc.numPages) {
                return;
            }
            pageNum++;
            queueRenderPage(pageNum);
        }
        function renderPage(num) {
            pageRendering = true;
            pdfDoc.getPage(num).then(function(page) {
                var viewport = page.getViewport({ scale: scale });
                canvas.height = viewport.height;
                canvas.width = viewport.width;
                canvas.style.width = '100%';
                canvas.style.height = '100%';
                var renderContext = {
                    canvasContext: ctx,
                    viewport: viewport
                };
                var renderTask = page.render(renderContext);
                renderTask.promise.then(function() {
                    pageRendering = false;
                    if (pageNumPending !== null) {
                        renderPage(pageNumPending);
                        pageNumPending = null;
                    }
                });
            });

            document.getElementById('page_num').textContent = num.toString();
        }

        var loadingTask = pdfjsLib.getDocument({ data: atob(data) });
        let date = document.querySelector(".date");
        date.innerText = Date.now();
        loadingTask.promise.then(function(pdf) {
            pdfDoc = pdf;
            document.getElementById('page_count').textContent = pdf.numPages.toString();
            canvas = document.getElementById('pdf');
            wrapper = document.getElementById('pdf-wrapper');
            // wrapper.style.width ="90%";
            // document.getElementById("pdf-wrapper").style.width = "80%";

            ctx = canvas.getContext('2d');
            prevButton = document.getElementById('prev').addEventListener('click', onPrevPage);
            nextButton = document.getElementById('next').addEventListener('click', onNextPage);
            renderPage(pageNum);
        });

    </script>
